$(function(){$("#selectBtn").on("change",function(){$("#newsGallery").empty();var e=event.target.value;$("#loadingAjax").show(),$.ajax({method:"GET",url:"https://api.nytimes.com/svc/topstories/v2/"+e+".json?"+$.param({"api-key":"9hT2g6DSGje8L7m2Vum1Htpx8YAtgv2k"})}).done(function(e){var t=0;$.each(e.results,function(e,a){a.multimedia[4]&&t<12&&(t++,$("#newsGallery").append('<a href="'+a.url+'" target="_blank"><li style="background-image:url('+a.multimedia[4].url+')"><p>'+a.title+"</p></li></a>")),$("#loadingAjax").hide()})})})});